import { useParams } from 'react-router-dom'; // importing the useParams hook from library
import { Fragment } from 'react'; // importing the Fragment component from react lib

const QuoteDetail = (props) => {

    const params = useParams(); // defining params using the useParams hook

    return (
        <Fragment>
            <h1>Quote Details Page</h1>
            <p>{params.quoteId}</p>
        </Fragment>

    );
};

export default QuoteDetail;
